import Main from '../../components/main/Main';

export default props => (
    <Main title="Início" subtitle="Sistema para cadastro de usuários" style={{ width:' 30%' }}>
      <div >
        <p className="mb-0">
          Sistema para exemplificar a construção de um cadastro desenvolvido em ReactS
        </p>
      </div>        
  </ Main>
)
